import "./App.css";
import A_propos from "./components/A_propos";
import Accueil from "./components/Accueil";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Projets from "./components/Projets";

function App() {
  return (
    <div className="App">
      <Header />
      <Accueil />
      <A_propos />
      <Projets></Projets>
      <Footer></Footer>
    </div>
  );
}

export default App;
